import { StyleSheet } from "react-native";

export default function Board() {

    const styless = StyleSheet.create({
        room: {
            width: '100px',
            height: '300px',
            backgroundColor: 'green'
        },
        fun: {
            width: '500px',
        }


      });

    return (
        <div style={styless.room} >
            hi
        </div>
    )


}
